    internal InnerOriginEndpointScteDashFactory ScteDashFactory { get; set; }

    protected override Humidifier.MediaPackageV2.OriginEndpointTypes.DashManifestConfiguration Create()
    {
        var dashManifestConfigurationResult = CreateDashManifestConfiguration();
        factoryAction?.Invoke(dashManifestConfigurationResult);

        return dashManifestConfigurationResult;
    }

    private Humidifier.MediaPackageV2.OriginEndpointTypes.DashManifestConfiguration CreateDashManifestConfiguration()
    {
        var dashManifestConfigurationResult = new Humidifier.MediaPackageV2.OriginEndpointTypes.DashManifestConfiguration();

        return dashManifestConfigurationResult;
    }
    public override void CreateChildren(Humidifier.MediaPackageV2.OriginEndpointTypes.DashManifestConfiguration result)
    {
        base.CreateChildren(result);

        result.UtcTiming ??= UtcTimingFactory?.Build();
        result.FilterConfiguration ??= FilterConfigurationFactory?.Build();
        result.ScteDash ??= ScteDashFactory?.Build();
    }

